                "sentence":"Chusquea culeou , the Chilean bamboo , is a species of flowering plant in the grass family Poaceae . An evergreen bamboo native to South America , unlike most species within the genus `` Chusquea `` , it is frost-tolerant and thus widely cultivated in temperate regions . It is native to the Valdivian rainforests , humid temperate forests of Chile and southwestern Argentina . Chusquea culeou is a keystone species which can control patterns of forest dynamics by impeding regeneration of tree species . Growing to tall by broad , `` Chusquea culeou '' forms a substantial clump of greenery .",
