                "sentence":"Launched in November 2006 , PSN was originally conceived for the PlayStation video game consoles , but soon extended to encompass smartphones , tablets , Blu-ray players and high-definition televisions . As of April 2016 , over 110 million users have been documented , with 113 million of them active monthly as of June 2020 . PlayStation Network 's services are dedicated to an online marketplace ( PlayStation Store ) , a premium subscription service for enhanced gaming and social features ( PlayStation Plus ) , movie streaming , rentals and free purchases ( PlayStation Video ) , music streaming ( PlayStation Music , powered by Spotify ) and a cloud gaming service ( PlayStation Now ) . The service is available in 73 territories . Launched in the year 2000 , Sony 's second home console , the PlayStation 2 , had rudimentary online features in select games via its online network .",
